import React from 'react'
import Button from '../components/common/Button'
import { useLogoutUser } from '../hooks/useLogoutUser'

function Header() {

  const handleLogOut = () => {
    useLogoutUser()
  }

  return (
    <div>Header
      <Button text="logout" onClick={handleLogOut()}></Button>
    </div>
  )
}

export default Header
